import React, { Component } from "react"; //useContext
//import { ProductsContext } from "../Global/ProductsContext";
//import products from "./data.js";
import data from "../data/data.json";
// const Products = () => {
//   const data = useContext(ProductsContext);
//   console.log(data);
//   return <h1>Products</h1>;
// };

class Products extends Component {
  render() {
    return (
      <div className="products">
        {data.map((dataDetail, index) => {
          return (
            <div className="product">
              {dataDetail.id}
              <div className="product-img">
                <img src={dataDetail.image} alt="handbag1" />
              </div>
              <div className="product-details">
                <div className="product-name">{dataDetail.name}</div>
                <div className="product-price">${dataDetail.price}.00</div>
                <div className="product-status">{dataDetail.status}</div>
              </div>
            </div>
          );
        })}
      </div>
    );
  }
}
export default Products;
